import { render, screen } from '@testing-library/react';
import { BrowserRouter } from 'react-router-dom';
import App from './App';

test('renders the navbar with Uber Eats text', () => {
  render(
    <BrowserRouter>
      <App />
    </BrowserRouter>
  );

  // Check if the Uber Eats text is present in the NavBar
  const navElement = screen.getByText(/Uber Eats/i);
  expect(navElement).toBeInTheDocument();
});

test('navigates to the sign-up page when clicking Sign Up', () => {
  render(
    <BrowserRouter>
      <App />
    </BrowserRouter>
  );

  // Check if the Sign Up link is rendered in the NavBar
  const signUpLink = screen.getByText(/Sign Up/i);
  expect(signUpLink).toBeInTheDocument();

  // Simulate a user clicking the Sign Up link
  signUpLink.click();

  // Check if the Sign Up page heading renders correctly
  const signUpHeading = screen.getByText(/Sign Up/i);
  expect(signUpHeading).toBeInTheDocument();
});
